import * as React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
//import { Table } from "./components/Table";
import { Home } from "./components/Home";
import { FatLoss } from "./FatLoss";
function App() {
  return (
    <Router>
      <Switch>
        <Home />
        <FatLoss />
      </Switch>
    </Router>
  );
}

export default App;
